import React from "react";
import { useHistory } from "react-router-dom";
import crash from '../image/crash.png';
import roulette from '../image/rullete.jpg';
import raffle from '../image/loterie.webp';

function Home() {
  const history = useHistory();

  const redirectToCrash = () => {
    history.push("/crash");
  };

  return (
    <div>
      <div className="pagesGame">
        <button className="poza1" onClick={redirectToCrash}></button>
        <div className="poza2"></div>
        <div className="poza3"></div>
      </div>
    </div>
  );
}

export default Home;
